<path d="M3 22L3.79 19.12C6.4 9.61999 17.6 9.61999 20.21 19.12L21 22" stroke="#151515" stroke-width="2.5" stroke-linecap="round" stroke-linejoin="round"/>
<path d="M12 11.98C14.7614 11.98 17 9.7414 17 6.97998C17 4.21856 14.7614 1.97998 12 1.97998C9.23858 1.97998 7 4.21856 7 6.97998C7 9.7414 9.23858 11.98 12 11.98Z" stroke="#151515" stroke-width="2.5" stroke-linecap="round" stroke-linejoin="bevel"/>
</svg>

    )
}

export default UserIcon
